import React, { Component } from "react";
import Jumbotron from "../components/Jumbotron";

class Home extends Component {
    render() {
        return (
            <div>
                <Jumbotron>
                    <h1>Nerdy Translator</h1>
                </Jumbotron>
            </div>
        )
    }

}

export default Home;
